import logo from '../logo.svg';
//import logo from './logo2.png'
import '../css/App.css';
import '../css/Visual.css';
import {ForceGraph, ForceGraphNode, ForceGraphLink} from 'react-vis-force';

var data;




export class Visual extends Component {

    componentDidMount(){
